package com.example.auta.domain.entities;import com.example.auta.models.enums.Position;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Data;import lombok.NoArgsConstructor;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import java.util.List;import java.util.UUID;@Entity@Data@NoArgsConstructor@Builder@AllArgsConstructorpublic class EmployeeEntity {    @Id    @GeneratedValue(generator = "uuid")    @GenericGenerator(name = "uuid", strategy = "org.hibernate.id.UUID")    private UUID id;    private String forname;    private String lastname;    private Position position;    @ManyToOne    private BranchEntity branch;    @OneToMany(mappedBy = "employee")    private List<RentEntity> rents;    @OneToMany(mappedBy = "employee")    private List<ReturnEntity> returns;}